-- ----------------------------
-- Table structure for acd_calendar
-- ----------------------------
DROP TABLE IF EXISTS `acd_calendar`;
CREATE TABLE `acd_calendar`  (
  `calendar_id` int(11) NOT NULL AUTO_INCREMENT,
  `calendar_type` int(11) NOT NULL COMMENT '1=events 2= task',
  `event_type` int(11) NOT NULL,
  `category` tinyint(4) NOT NULL DEFAULT 0,
  `name` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `location` text CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `latitude` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0.00',
  `longitude` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `status` tinyint(4) NOT NULL DEFAULT 1,
  `duration` tinyint(4) NOT NULL COMMENT '0=custom 1=allday',
  `start_date` datetime(0) NOT NULL,
  `end_date` datetime(0) NOT NULL,
  `due_date` datetime(0) NOT NULL,
  `note` text CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `is_recurrence` int(11) NOT NULL,
  `assigned_to` int(11) NOT NULL,
  `related_to` varchar(50) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `calendar_for` int(11) NOT NULL COMMENT '0=selft 1= contacts,2=company',
  `for_id` int(11) NOT NULL,
  `is_opportunity` int(11) NOT NULL DEFAULT 0,
  `is_automation` enum('0','1') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0',
  `automation_assign_id` int(11) NOT NULL,
  `source_type` int(11) NOT NULL DEFAULT 0 COMMENT '0=Web,1=Android.2=IOS,3=Widget',
  `created_date` datetime(0) NOT NULL,
  `created_by` int(11) NOT NULL,
  `modified_date` datetime(0) NOT NULL,
  `modified_by` int(11) NOT NULL,
  PRIMARY KEY (`calendar_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5715 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

